import React, { Component } from "react";
import { Button, Input } from "antd";
import "antd/dist/antd.css";
import "../App.css";

class Form extends Component {
  render() {
    return (
      <div className="App">
        <Input
          placeholder="Basic usage"
          size="middle"
          style={{ width: "300px" }}
        />
        <Button type="primary">add</Button>

        <div
          className="App"
          style={{
            height: "200px",
            backgroundColor: "grey",
            textAlign: "center"
          }}
        >
          hello
        </div>
      </div>
    );
  }
}

export default Form;
